import React, { Component } from 'react';
import Sidebar from './Sidebar'

const students =[
  {name:'seokwonchoi', label:'Seokwon Choi'}
]
class App extends Component {
  render() {
    return (
      <div>
        <Sidebar students={students}/>
      </div>
    )
  }
}

export default App
